import fetch from "node-fetch";

const videoApi = async () => {
  await fetch("http://ign-apis.herokuapp.com/videos", {
    method: "GET",
    headers: {
      Accept: "application/json",
      "Content-Type": "application/json",
    },
  })
    .then((res) => res.json())
    .then((data) => console.log(data))
    .catch((err) => console.log(err));
};

videoApi();
